import { Route } from "react-router-dom";
import React from "react";

function navBarTest() {
  return (
    <div>
      <Route path="/first">
        <h1>First Page</h1>
      </Route>
      <Route path="/second">
        <h1>Second Page</h1>
      </Route>
      <Route path="third">
        <h1>Third Page</h1>
      </Route>
      <Route path="forth">
        <h1>Forth Page</h1>
      </Route>
    </div>
  );
}

export default navBarTest;
